INSERT INTO `t_s_notice` VALUES ('402880ea5330fe22015331062a040002', '新公告', '<fieldset class=\"brcolor\" style=\"max-width: 100%; border: 1px dotted rgb(192, 80, 77); padding: 20px; min-height: 1.5em; border-bottom-right-radius: 15px; border-bottom-left-radius: 10px; word-wrap: break-word !important;\"><legend style=\"font-family: 微软雅黑; line-height: 2em; max-width: 100%; padding: 0px; text-align: center; margin: 0px; border: none; border-image-source: initial; border-image-slice: initial; border-image-width: initial; border-image-outset: initial; border-image-repeat: initial; word-wrap: break-word !important;\"><p class=\"bkcolor\" style=\"word-wrap: normal; font-size: 14px; max-width: 100%; word-break: normal; color: rgb(255, 255, 255); padding: 0px 20px 4px; margin-top: 0px; margin-bottom: 0px; min-height: 1.5em; line-height: 2em; border-bottom-right-radius: 100%!important; border-bottom-left-radius: 100%!important; background-color: rgb(192, 80, 77);\"><strong><span style=\"font-size: 16px;\">捷微H5营销活动平台专题公开课</span></strong><br/></p></legend><p style=\"word-wrap: normal; max-width: 100%; word-break: normal; padding: 0px; margin-top: 0px; margin-bottom: 0px; min-height: 1.5em;\"><span style=\"font-family: 微软雅黑; line-height: 25.6px; color: rgb(62, 62, 62); font-size: 14px; background-color: rgb(249, 249, 249);\">&nbsp; &nbsp; <span style=\"font-family: 微软雅黑; line-height: 25.6px; color: rgb(0, 0, 0); background-color: rgb(216, 216, 216);\"><em>还在为如何做好微信营销头疼吗？</em></span></span></p><p style=\"word-wrap: normal; max-width: 100%; word-break: normal; padding: 0px; margin-top: 0px; margin-bottom: 0px; min-height: 1.5em;\"><span style=\"font-family: 微软雅黑; line-height: 25.6px; color: rgb(62, 62, 62); font-size: 14px; background-color: rgb(249, 249, 249);\">&nbsp; &nbsp; 微信时代，层出不穷花样百出的营销活动已毫无质疑地成为商家吸粉营销的首选利器，而其中HTML5作为营销界新宠儿，“多快好省”的杰出代表，其灵活性高、开发成本低且制作周期短的种种特性使其在移动营销领域大放异彩。新年伊始，JEEWX隆重推出H5营销活动平台，汇集各种您想到的想不到的小游戏小活动，各种需求轻松创建，一键营销！</span></p><p style=\"word-wrap: normal; max-width: 100%; word-break: normal; padding: 0px; margin-top: 0px; margin-bottom: 0px; min-height: 1.5em;\"><span style=\"font-family: 微软雅黑; line-height: 25.6px; color: rgb(62, 62, 62); font-size: 14px; background-color: rgb(249, 249, 249);\">&nbsp; &nbsp; 为帮助大家快速掌握捷微H5营销活动平台的使用及开发流程，JEECG开源社区近期将推出专题公开课，欢迎大家报名参加，共同学习！</span></p><p style=\"word-wrap: normal; max-width: 100%; word-break: normal; padding: 0px; margin-top: 0px; margin-bottom: 0px; min-height: 1.5em;\"><span style=\"font-family: 微软雅黑; line-height: 25.6px; color: rgb(62, 62, 62); font-size: 14px; background-color: rgb(249, 249, 249);\"><br/></span></p><p style=\"word-wrap: normal; max-width: 100%; word-break: normal; padding: 0px; margin-top: 0px; margin-bottom: 0px; min-height: 1.5em;\"><strong><span style=\"color:#3e3e3e;font-family:微软雅黑\"><span style=\"line-height: 25.6px; font-size: 14px; background-color: rgb(249, 249, 249);\">&nbsp; &nbsp; 开课时间：</span></span></strong><span style=\"color:#3e3e3e;font-family:微软雅黑\"><span style=\"line-height: 25.6px; font-size: 14px; background-color: rgb(249, 249, 249);\">2016年1月7日20：30-21:30 &nbsp; &nbsp; 1月12日20:30-21:30</span></span></p><p style=\"word-wrap: normal; max-width: 100%; word-break: normal; padding: 0px; margin-top: 0px; margin-bottom: 0px; min-height: 1.5em;\"><span style=\"color: rgb(255, 0, 0);\"><strong><span style=\"color:#3e3e3e;font-family:微软雅黑\"><span style=\"line-height: 25.6px; font-size: 14px; background-color: rgb(249, 249, 249);\">&nbsp; &nbsp; 开课地点：</span></span></strong></span><span style=\"color:#3e3e3e;font-family:微软雅黑\"><span style=\"line-height: 25.6px; font-size: 14px; background-color: rgb(249, 249, 249);\"><a href=\"http://ke.qq.com/course/111073#term_id=100119113\" _src=\"http://ke.qq.com/course/111073#term_id=100119113\">http://ke.qq.com/course/111073#term_id=100119113</a> </span></span></p><p style=\"word-wrap: normal; max-width: 100%; word-break: normal; padding: 0px; margin-top: 0px; margin-bottom: 0px; min-height: 1.5em;\"><span st